--Execute on Microsoft SQL Server 2016 or later, with sysadmin priviledges
DECLARE
	@SchemaName nvarchar(128) = 'tdq'--All objects will be created in this schema
	,@Prefix nvarchar(128) = ''--All objects will be prefixed with this in their name
	,@Enabled bit = 1;--Enable and start TDQ immediately

SET NOCOUNT ON;
IF OBJECT_ID('[' + @SchemaName + '].[' + @Prefix + 'Box]') IS NOT NULL THROW 50000, 'Box table already exists. Did you already run bootstrap? You can execute the unpack procedure, or drop the Box table, or change schema or prefix', 1
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable
SELECT ObjectName,ObjectType,ObjectSequence,CAST('' AS xml).value('xs:base64Binary(sql:column("DefinitionBinary"))','varbinary(max)')DefinitionBinary,DefinitionText,DefinitionDecimal,DefinitionDate,DefinitionBit INTO #BoxTable FROM (VALUES
	(N'AgentCategoryName','CONF',0,NULL,N'TacticalDQ',NULL,CAST(NULL AS datetimeoffset),CAST(NULL AS bit))
	,(N'AgentEnabled','CONF',0,NULL,NULL,NULL,NULL,'1')
	,(N'AgentIntervalMinutes','CONF',0,NULL,NULL,10.00000,NULL,NULL)
	,(N'AgentJobName','CONF',0,NULL,N'TacticalDQ_tdq_alpha_Scheduler',NULL,NULL,NULL)
	,(N'Box','TABL',0,'',NULL,NULL,NULL,NULL)
	,(N'HomePrefix','CONF',0,NULL,N'alpha_',NULL,NULL,NULL)
	,(N'HomeSchema','CONF',0,NULL,N'tdq',NULL,NULL,NULL)
	,(N'License','CONF',0,NULL,N'CatHerd Tactical DQ by DJ Olsen\nhttps://github.com/davolsen/tacticaldq\n\nThis program is free software: you can redistribute it and/or modify it under the terms of the GNU General Public License as published by the Free Software Foundation, either version 3 of the License, or (at your option) any later version.\n\nThis program is distributed in the hope that it will be useful, but WITHOUT ANY WARRANTY; without even the implied warranty of MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. See the GNU General Public License for more details.\n\nYou should have received a copy of the GNU General Public License along with this program. If not, see <https://www.gnu.org/licenses/>.',NULL,NULL,NULL)
	,(N'MailErrorAddress','CONF',0,NULL,N'dj@olsen.gen.nz',NULL,NULL,NULL)
	,(N'MailErrorReporting','CONF',0,NULL,NULL,NULL,NULL,'1')
	,(N'MailFromAddress','CONF',0,NULL,N'tdq@olsen.gen.nz',NULL,NULL,NULL)
	,(N'MailFromName','CONF',0,NULL,N'Tactical DQ Notification',NULL,NULL,NULL)
	,(N'MailProfileDescription','CONF',0,NULL,N'Tactical DQ Notifications',NULL,NULL,NULL)
	,(N'MailProfileName','CONF',0,NULL,N'TacticalDQ_tdq_alpha_Mail',NULL,NULL,NULL)
	,(N'MailServerAddress','CONF',0,NULL,N'olsen.gen.nz',NULL,NULL,NULL)
	,(N'MailServerPort','CONF',0,NULL,NULL,25.00000,NULL,NULL)
	,(N'MailServerSSL','CONF',0,NULL,NULL,NULL,NULL,'0')
	,(N'MailServerType','CONF',0,NULL,N'SMTP',NULL,NULL,NULL)
	,(N'MailTemplateMeasureError','CONF',0,NULL,N'An error occurred while taking a measurement.\n\nMeasure Code: $PARAMETER1$\nMeasureID: $PARAMETER2$\nMeasurementID: $PARAMETER3$\n\nError Message: $PARAMETER4$',NULL,NULL,NULL)
	,(N'MeasureViewPattern','CONF',0,NULL,N'measure[_]%',NULL,NULL,NULL)
	,(N'RefreshPolicyDefault','CONF',0,NULL,N'Continuous',NULL,NULL,NULL)
	,(N'RefreshTimeOffsetDefault','CONF',0,NULL,NULL,NULL,'0001-01-01 00:30:00 +00:00',NULL)
	,(N'ReportHistoryDays','CONF',0,NULL,NULL,28.00000,NULL,NULL)
	,(N'SchedulerMaxParallelRefreshes','CONF',0,NULL,NULL,5.00000,NULL,NULL)
	,(N'Unpack','CODE',0,'',NULL,NULL,NULL,NULL)
	,(N'WorkingTimezoneName','CONF',0,NULL,N'New Zealand Standard Time',NULL,NULL,NULL)
	,(N'Cases','TABL',1,'',NULL,NULL,NULL,NULL)
	,(N'Log','TABL',1,'',NULL,NULL,NULL,NULL)
	,(N'Refreshes','TABL',1,'',NULL,NULL,NULL,NULL)
	,(N'BoxBit','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'BoxDate','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'BoxDec','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'BoxText','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'CasesSummary','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'MailSend','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'RefreshMergeStatement','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'RefreshTempColumns','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'RoundDate','CODE',10,'',NULL,NULL,NULL,NULL)
	,(N'Measures','CODE',30,'',NULL,NULL,NULL,NULL)
	,(N'Refresh','CODE',31,'',NULL,NULL,NULL,NULL)
	,(N'RefreshFromQueue','CODE',32,'',NULL,NULL,NULL,NULL)
	,(N'AgentConfig','CODE',40,'',NULL,NULL,NULL,NULL)
	,(N'MailConfig','CODE',40,'',NULL,NULL,NULL,NULL)
	,(N'SchedulerConfig','CODE',40,'',NULL,NULL,NULL,NULL)
	,(N'Schedule','CODE',41,'',NULL,NULL,NULL,NULL)
	,(N'ScheduleCurrent','CODE',42,'',NULL,NULL,NULL,NULL)
	,(N'ReportCaseLists','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportCases','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportCasesDaily','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportLog','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportMeasureProperties','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportMeasures','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportRefreshesDetail','CODE',50,'',NULL,NULL,NULL,NULL)
	,(N'ReportCasesDailyXML','CODE',60,'',NULL,NULL,NULL,NULL)
	,(N'ReportCasesXML','CODE',60,'',NULL,NULL,NULL,NULL)
	,(N'ReportLogXML','CODE',60,'',NULL,NULL,NULL,NULL)
	,(N'ReportMeasurePropertiesXML','CODE',60,'',NULL,NULL,NULL,NULL)
	,(N'ReportMeasuresXML','CODE',60,'',NULL,NULL,NULL,NULL)
	,(N'PackTableDefinitions','CODE',100,'',NULL,NULL,NULL,NULL)
	,(N'GenerateBootstrapScript','CODE',101,'',NULL,NULL,NULL,NULL)
	,(N'Pack','CODE',102,'',NULL,NULL,NULL,NULL)
	,(N'Teardown','CODE',103,'',NULL,NULL,NULL,NULL)
	,(N'measure_CUST-MAST-BGRP','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_CUST-MAST-NAME','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_CUST-MAST-PAYD','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_CUST-MAST-PHNO','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_CUST-TRAN-ORDQ','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_SALE-TRAN-DELV','MESR',200,'',NULL,NULL,NULL,NULL)
	,(N'measure_SALE-TRAN-PONO','MESR',200,'',NULL,NULL,NULL,NULL)
)Box(ObjectName,ObjectType,ObjectSequence,DefinitionBinary,DefinitionText,DefinitionDecimal,DefinitionDate,DefinitionBit)
UPDATE #BoxTable SET AgentEnabled = @Enabled
DECLARE @SQL nvarchar(4000)=REPLACE(REPLACE((SELECT CAST(DECOMPRESS(DefinitionBinary) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Box'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
EXEC (@SQL);
SET @SQL ='INSERT ['+@SchemaName+'].['+@Prefix+'Box] SELECT ObjectName,ObjectType,ObjectSequence,DefinitionBinary,DefinitionText,DefinitionDecimal,DefinitionDate,DefinitionBit FROM #BoxTable';
EXEC (@SQL);
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(DefinitionBinary) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Unpack'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
SET @SQL =REPLACE(REPLACE(@SQL,'[/$schema/$]','[$schema$]'),'[/$prefix/$','[$prefix$');
EXEC (@SQL);
SET @SQL ='EXEC ['+@SchemaName+'].['+@Prefix+'Unpack]'
EXEC (@SQL);
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable;